import React from 'react';
import CalculatorForm from "./components/CalculatorForm";
import ResultsTable from "./components/ResultsTable";

function App() {
  const [results, setResults] = useState<Result[]>([]);

  return (
    <div className="App">
      <CalculatorForm />
      <ResultsTable results={results} />
    </div>
  );
}

export default App;
